import { Avatar, Card } from "antd";

const UserProfile = () => {
  return (
    <Card
      actions={[
        <>
          <div key="twit">짹쨱</div>
          <div></div>
          <div></div>
        </>,
      ]}
    >
      <Card.Meta avatar={<Avatar>JS</Avatar>} title="jangsan " />
    </Card>
  );
};

export default UserProfile;
